import UserScrapsIn from './review/UserScrapsIn';
import UserScrapsOut from './review/UserScrapsOut';

const UserScraps = () => {
  return (
    <div>
      <div>UserScraps</div>
      <UserScrapsIn></UserScrapsIn>
      <UserScrapsOut></UserScrapsOut>
    </div>
  );
};
export default UserScraps;
